class Solution {
    public long minimumCost(int[] nums, int k, int dist) {
        int n = nums.length;
        long[][] dp = new long[k][n];
        long[] prefixSum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
            dp[0][i] = nums[i];
        }

        for (int i = 1; i < k; i++) {
            for (int j = 0; j < n; j++) {
                dp[i][j] = Long.MAX_VALUE;
                for (int l = Math.max(0, i - 1); l <= j - 1 && j - l <= dist + 1; l++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][l] + nums[j]);
                }
            }
        }

        long minCost = Long.MAX_VALUE;
        for (int i = k - 2; i < n; i++) {
            if (n - i - 1 <= dist) {
                minCost = Math.min(minCost, dp[k - 1][i]);
            }
        }
        return minCost;
    }
}
